import React, { Component } from "react";

const TITLES = [
    "A Software Engineer",
    "A Music Lover",
    "An Enthusiast Learner",
    "Peace Lover"
];

class Title extends Component{
    state = { titleIndex:0};
    render(){
        const title = TITLES[this.state.titleIndex];
        return(
            <p>I am {title}</p>
        )
    }
}

export default Title;
